                        </PageHeader>
                    </Content>
                    <BlogBottom/>
                    {/* <Footer>
                    <BlogBottom/>
                    </Footer> */}
                </Layout>            
            </div>
        )
    }
}

export default withRouter(BlogCommonBackGround)
